  false,\n\t\"url\": null,\n\t\"notes\": \"This multibeam backscatter sonar image
  of the sea floor (0-200 m water depths) was mosaiced from data collected fromvarious
  mapping efforts each October from 2001-2004. Reson 8101 (240 kHz) and Reson 8125
  (455kHz) multibeam echosounders werehull mounted to survey launches and deployed
  from the NOAA ship Rainier. Either Trimble or CSI wireless DGPS were used forlaunch
  positioning. TSS or Applanix Pos/MV were used to compensate for vessel motion. A
  Seabird SVP 19 plus was used to correctfor sound velocity refraction. Navigation
  and line planning were accomplished with Hypack. Sonar packets, motion sensor, andnavigation
  data were logged in Isis Sonar as XTF files. Backscatter was normalized using propietary
  software developed by theUniversity of New Brunswick Ocean Mapping Group.\",\n\t\"license_title\":
